<co-content>
 <p>
  <a href="http://eldf.ru/" title="">
   <strong>
    Фонд развития онлайн-образования
   </strong>
  </a>
  (ФРОО) объединяет образовательные стартапы, проекты в области EdTech и запускает собственные онлайн-программы в области машинного обучения, программирования, мобильной разработки, VR, дизайна и IT.
 </p>
 <p>
  Мы выстраиваем экосистему для обучения на всех стадиях жизненного цикла: от идеи и поиска средств на производство образовательной программы до поддержки, продаж и маркетинга. А сотрудничество с крупнейшими образовательными платформами позволяет запускать онлайн-курсы с максимальным эффектом и пользой для всех заинтересованных сторон.
 </p>
 <p>
  То, что мы делаем каждый день:
 </p>
 <ul bullettype="bullets">
  <li>
   <p>
    Общаемся с экспертами рынка EdTech, делимся опытом и знаниями
   </p>
  </li>
  <li>
   <p>
    Ищем образовательные проекты и предлагаем им помощь в развитии цифровых продуктов
   </p>
  </li>
  <li>
   <p>
    Продюсируем, создаем и продвигаем собственные образовательные программы
   </p>
  </li>
  <li>
   <p>
    Создаем корпоративные онлайн-программы для партнеров
   </p>
  </li>
  <li>
   <p>
    Учимся, учимся и еще раз учимся
   </p>
  </li>
 </ul>
 <p>
 </p>
 <p>
 </p>
</co-content>
